import React, { useState } from "react";
import { Link } from "react-router-dom";
import styles from "./Categories.module.css";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";

function Categories(props) {
  const [selectedItem, setSelectedItem] = useState(null);
  const { items } = props;

  const openModal = (item) => {
    setSelectedItem(item);
    const modal = new window.bootstrap.Modal(document.getElementById("exampleModal"));
    modal.show();
  };

  const closeModal = () => {
    setSelectedItem(null);
    const modal = new window.bootstrap.Modal(document.getElementById("exampleModal"));
    modal.hide();
  };

  return (
    <>
      <h1 className="text-center">Menu</h1>

      <div className="card-container text-center row row-cols-sm-2 row-cols-md-3">
        {items.map((item) => (
          <div key={item.name} className="col mb-4">
            <div className={`${styles.myCard} card`}>
              <img
                src={item.image}
                className={`${styles.myImg} card-img-top`}
                alt="..."
              />
              <div className="card-body">
                <h5 className="card-title">{item.name}</h5>
                <p className="card-text">{item.calK}</p>
                <span>{item.currentPrice}</span>
                <span>{item.orignalPrice}</span>
                <span>{item.discount}</span>
                <div>
                  <Link
                    to="#"
                    className={`${styles.btnText} btn btn-outline-white mt-2`}
                  >
                    Add to Cart
                  </Link>

                  <button
                    type="button"
                    className="btn btn-primary"
                    onClick={() => openModal(item)}
                  >
                    Launch demo modal
                  </button>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>

      {selectedItem && (
        <div
          className="modal fade"
          id="exampleModal"
          tabIndex="-1"
          aria-labelledby="exampleModalLabel"
          aria-hidden="true"
        >
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h1 className="modal-title fs-5" id="exampleModalLabel">
                  Modal title
                </h1>
                <button
                  type="button"
                  className="btn-close"
                  data-bs-dismiss="modal"
                  aria-label="Close"
                  onClick={closeModal}
                ></button>
              </div>
              <div className="modal-body">
                <div className="card">
                  <img src={selectedItem.image} className="card-img-top" alt="..." />
                  <div className="card-body">
                    <h5 className="card-title">{selectedItem.name}</h5>
                    <p className="card-text">{selectedItem.calK}</p>
                    <span>{selectedItem.currentPrice}</span>
                    <span>{selectedItem.orignalPrice}</span>
                    <span>{selectedItem.discount}</span>
                  </div>
                </div>
              </div>
              <div className="modal-footer">
                <button
                  type="button"
                  className="btn btn-secondary"
                  data-bs-dismiss="modal"
                  onClick={closeModal}
                >
                  Close
                </button>
                <button type="button" className="btn btn-primary">
                  Save changes
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </>
  );
}

export default Categories;
